import React, { Component } from 'react'
import { Link } from 'react-router-dom'

export default class Notfound extends Component {
    render() {
        return (
            <div>
                <h1>Error! 404 Page Not Found!</h1>
                <Link to='/'>Go to HomePage</Link>
            </div>
        )
    }
}
